window.bookSummaryJSON = "<p>If you love the Dark Protectors, these wicked hot Realm Enforcers are for you! </p> <p>Daire Dunne is more than ready to take a quick break from his duties as a Coven Nine Enforcer. When he spots a sexy blonde across a Titans of Fire party, it's not long before she's on the back of his Harley on the fast track to his apartment. Unfortunately, one overheated kiss in, the woman drugs Daire and steals valuable files that can't fall into enemy hands. The second he comes to, the hunt is on.... </p> <p>Now that Cee Cee has the information to take down an enemy that destroyed her family, she can implement her perfect plan for revenge. Nothing will stop her, not even a shockingly sexy enforcer barging into her life. Not even the spectacular, fire-branding sex engulfing them. But if Daire ever figures out who her family really is, all bets are off.... </p>"; 
